import "./App.css";
import SearchField from './Searchfield'
import Product from "./Product";

function App() {
  return (
    <div class="App">
      <header>
        <h1>Kjell-scraper</h1>
      </header>
      <SearchField />
      <div className="contianer">
        <Product />
      </div>
    </div>
  );
}

export default App;
